import { ChangeEvent } from "react";


export const AddHabit = ({handleChange, handleSubmit}: {handleChange: (event: ChangeEvent<HTMLInputElement>) => void, handleSubmit: () => void}) => {
  return (
    <form>
        <input type="text" id="New Habit" onChange={() => handleChange}/>
        <input type="button" id="Submit Habit" value="Add Habit" onClick={() => handleSubmit}/>
    </form>
  )
}
